        InstanceJournal(id: 236, name: "Stratholme", map: InstanceMapIndex(name: "Stratholme", id: 329), description: "Stratholme was once the jewel of northern Lordaeron, but today it is remembered for its harrowing fall to ruin. It was here that Prince Arthas turned his back on the noble paladin Uther Lightbringer, slaughtering countless residents believed to be infected with the horrific plague of undeath. Ever since, cursed Stratholme has been marred by death, betrayal, and hopelessness.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/443?namespace=static-8.3.7_35114-eu"), id: 443, name: "Hearthsinger Forresten"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/445?namespace=static-8.3.7_35114-eu"), id: 445, name: "Timmy the Cruel"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/749?namespace=static-8.3.7_35114-eu"), id: 749, name: "Commander Malor"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/446?namespace=static-8.3.7_35114-eu"), id: 446, name: "Willey Hopebreaker"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/448?namespace=static-8.3.7_35114-eu"), id: 448, name: "Instructor Galford"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/449?namespace=static-8.3.7_35114-eu"), id: 449, name: "Balnazzar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/450?namespace=static-8.3.7_35114-eu"), id: 450, name: "The Unforgiven"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/451?namespace=static-8.3.7_35114-eu"), id: 451, name: "Baroness Anastari"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/452?namespace=static-8.3.7_35114-eu"), id: 452, name: "Nerub\'enkan")