        InstanceJournal(id: 237, name: "The Temple of Atal\'hakkar", map: InstanceMapIndex(name: "Sunken Temple", id: 109), description: "Thousands of years ago, the Gurubashi empire was plunged into a civil war by a powerful sect of priests, the Atal\'ai, who sought to summon to Azeroth an avatar of their god of blood, Hakkar the Soulflayer. The Gurubashi people exiled the Atal\'ai to the Swamp of Sorrows, where the priests built the Temple of Atal\'Hakkar. Ysera, Aspect of the green dragonflight, sank the temple beneath the swamp and assigned wardens to ensure that the summoning rituals never be performed again.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/457?namespace=static-8.3.7_35114-eu"), id: 457, name: "Avatar of Hakkar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/458?namespace=static-8.3.7_35114-eu"), id: 458, name: "Jammal\'an the Prophet"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/459?namespace=static-8.3.7_35114-eu"), id: 459, name: "Wardens of the Dream"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/463?namespace=static-8.3.7_35114-eu"), id: 463, name: "Shade of Eranikus")], expansion: ExpansionIndex(id: 68, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/68?namespace=static-8.3.7_35114-eu"), name: "Classic"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/237?namespace=static-8.3.7_35114-eu"), id: 237), minimumLevel: 45, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 238, name: "The Stockade", map: InstanceMapIndex(name: "Stormwind Stockade", id: 34), description: "Stormwind Stockade is a closely guarded prison built beneath the canals of Stormwind City. Warden Thelwater keeps watch over the stockade and the highly dangerous criminals who call it home. Recently, the inmates revolted, overthrowing their guards and plunging the prison into a state of pandemonium.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/464?namespace=static-8.3.7_35114-eu"), id: 464, name: "Hogger"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/465?namespace=static-8.3.7_35114-eu"), id: 465, name: "Lord Overheat"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/466?namespace=static-8.3.7_35114-eu"), id: 466, name: "Randolph Moloch")], expansion: ExpansionIndex(id: 68, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/68?namespace=static-8.3.7_35114-eu"), name: "Classic"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/238?namespace=static-8.3.7_35114-eu"), id: 238), minimumLevel: 15, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 239, name: "Uldaman", map: InstanceMapIndex(name: "Uldaman", id: 70), description: "Uldaman is an ancient titan vault buried deep within the earth. It is said the titans sealed away a failed experiment there and then moved on to a new project, related to the genesis of the dwarves. Tales of a fabled treasure containing great knowledge have enticed would-be treasure hunters to dig deeper into the secrets of Uldaman, a task made perilous by the presence of stone defenders, savage troggs, Dark Iron invaders, and other dangers lurking in the lost city.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/467?namespace=static-8.3.7_35114-eu"), id: 467, name: "Revelosh"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/468?namespace=static-8.3.7_35114-eu"), id: 468, name: "The Lost Dwarves"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/469?namespace=static-8.3.7_35114-eu"), id: 469, name: "Ironaya"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/748?namespace=static-8.3.7_35114-eu"), id: 748, name: "Obsidian Sentinel"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/470?namespace=static-8.3.7_35114-eu"), id: 470, name: "Ancient Stone Keeper"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/471?namespace=static-8.3.7_35114-eu"), id: 471, name: "Galgann Firehammer"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/472?namespace=static-8.3.7_35114-eu"), id: 472, name: "Grimlok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/473?namespace=static-8.3.7_35114-eu"), id: 473, name: "Archaedas")], expansion: ExpansionIndex(id: 68, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal