        InstanceJournal(id: 240, name: "Wailing Caverns", map: InstanceMapIndex(name: "Wailing Caverns", id: 43), description: "Years ago, the famed druid Naralex and his followers descended into the shadowy Wailing Caverns, named for the mournful cry one hears when steam bursts from the cave system\'s fissures. Naralex planned to use the underground springs to restore lushness to the arid Barrens. But upon entering the Emerald Dream, he saw his vision of regrowth turn into a waking nightmare, one that has plagued the caverns ever since.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/474?namespace=static-8.3.7_35114-eu"), id: 474, name: "Lady Anacondra"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/476?namespace=static-8.3.7_35114-eu"), id: 476, name: "Lord Pythas"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/475?namespace=static-8.3.7_35114-eu"), id: 475, name: "Lord Cobrahn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/477?namespace=static-8.3.7_35114-eu"), id: 477, name: "Kresh"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/478?namespace=static-8.3.7_35114-eu"), id: 478, name: "Skum"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/479?namespace=static-8.3.7_35114-eu"), id: 479, name: "Lord Serpentis"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/480?namespace=static-8.3.7_35114-eu"), id: 480, name: "Verdan the Everliving"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/481?namespace=static-8.3.7_35114-eu"), id: 481, name: "Mutanus the Devourer")], expansion: ExpansionIndex(id: 68, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/68?namespace=static-8.3.7_351