        InstanceJournal(id: 241, name: "Zul\'Farrak", map: InstanceMapIndex(name: "Zul\'Farrak", id: 209), description: "Zul\'Farrak was once the shining jewel of Tanaris, ferociously protected by the cunning Sandfury tribe. Despite the trolls\' tenacity, this isolated group was forced to surrender much of its territory throughout history. Now, it appears that Zul\'Farrak\'s inhabitants are creating a horrific army of undead trolls to conquer the surrounding region. Other disturbing rumors tell of an ancient creature sleeping within the city--one that, if awakened, will rain death and destruction across Tanaris.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/483?namespace=static-8.3.7_35114-eu"), id: 483, name: "Gahz\'rilla"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/484?namespace=static-8.3.7_35114-eu"), id: 484, name: "Antu\'sul"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/485?namespace=static-8.3.7_35114-eu"), id: 485, name: "Theka the Martyr"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/486?namespace=static-8.3.7_35114-eu"), id: 486, name: "Witch Doctor Zum\'rah"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/487?namespace=static-8.3.7_35114-eu"), id: 487, name: "Nekrum & Sezz\'ziz"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/489?namespace=static-8.3.7_35114-eu"), id: 489, name: "Chief Ukorz Sandscalp")], expansion: ExpansionIndex(id: 68, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/68?namespace=static-8.3.7_35114-eu"), name: "Classic"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journ