        InstanceJournal(id: 246, name: "Scholomance", map: InstanceMapIndex(name: "Scholomance", id: 1007), description: "Individuals seeking to master the powers of undeath know well of Scholomance, the infamous school of necromancy located in the dark and foreboding crypts beneath Caer Darrow. In recent years, several of the instructors have changed, but the institution remains under the control of Darkmaster Gandling, a particularly sadistic and insidious practitioner of necromantic magic.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/659?namespace=static-8.3.7_35114-eu"), id: 659, name: "Instructor Chillheart"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/663?namespace=static-8.3.7_35114-eu"), id: 663, name: "Jandice Barov"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/665?namespace=static-8.3.7_35114-eu"), id: 665, name: "Rattlegore"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/666?namespace=static-8.3.7_35114-eu"), id: 666, name: "Lilian Voss"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/684?namespace=static-8.3.7_35114-eu"), id: 684, name: "Darkmaster Gandling")], expansion: ExpansionIndex(id: 68, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/68?namespace=static-8.3.7_35114-eu"), name: "Classic"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/246?namespace=static-8.3.7_35114-eu"), id: 246), minimumLevel: 9