        InstanceJournal(id: 311, name: "Scarlet Halls", map: InstanceMapIndex(name: "Scarlet Halls", id: 1001), description: "The Crusade\'s fiercest warriors, those who have held their ground and fought to defend the monastery throughout these dark times, are rapidly preparing an army within the Scarlet Halls. These soldiers are bound by their hatred of the unliving, and they are willing to sacrifice everything for their order\'s righteous cause.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/660?namespace=static-8.3.7_35114-eu"), id: 660, name: "Houndmaster Braun"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/654?namespace=static-8.3.7_35114-eu"), id: 654, name: "Armsmaster Harlan"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/656?namespace=static-8.3.7_35114-eu"), id: 656, name: "Flameweaver Koegler")], expansion: ExpansionIndex(id: 68, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/68?namespace=static-8.3.7_35114-eu"), name: "Classic"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/311?namespace=static-8.3.7_35114-eu"), id: 311), minimumLevel: 90, category: InstanceCategory(type: .dungeon)),
