        InstanceJournal(id: 271, name: "Ahn\'kahet: The Old Kingdom", map: InstanceMapIndex(name: "Ahn\'kahet: The Old Kingdom", id: 619), description: "Azjol-Nerub was an empire of great strength when the Lich King arrived in Northrend. Despite ferocious resistance, however, Scourge forces managed to overtake the subterranean kingdom and slaughter its inhabitants, the nerubians. Scarred by years of war and abandonment, this vast domain is now occupied on two fronts.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/580?namespace=static-8.3.7_35114-eu"), id: 580, name: "Elder Nadox"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/581?namespace=static-8.3.7_35114-eu"), id: 581, name: "Prince Taldaram"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/582?namespace=static-8.3.7_35114-eu"), id: 582, name: "Jedoga Shadowseeker"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/583?namespace=static-8.3.7_35114-eu"), id: 583, name: "Amanitar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/584?namespace=static-8.3.7_35114-eu"), id: 584, name: "Herald Volazj")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/271?namespace=static-8.3.7_35114-eu"), id: 271), minimumLevel: 80, category: InstanceCategory(type: .dungeon)),
