        InstanceJournal(id: 273, name: "Drak\'Tharon Keep", map: InstanceMapIndex(name: "Drak\'Tharon Keep", id: 600), description: "Drak\'Tharon Keep once served the Drakkari trolls as a formidable outpost at the edge of their kingdom, Zul\'Drak, but a recent Scourge invasion has delivered the fortress into the Lich King\'s hands. The keep\'s fallen defenders are now the Lich King\'s undead minions, and they are advancing into the heart of Drakkari territory.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/588?namespace=static-8.3.7_35114-eu"), id: 588, name: "Trollgore"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/589?namespace=static-8.3.7_35114-eu"), id: 589, name: "Novos the Summoner"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/590?namespace=static-8.3.7_35114-eu"), id: 590, name: "King Dred"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/591?namespace=static-8.3.7_35114-eu"), id: 591, name: "The Prophet Tharon\'ja")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/273?namespace=static-8.3.7_35114-eu"), id: 273), minimumLevel: 80, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 274, name: "Gundrak", map: InstanceMapIndex(name: "Gundrak", id: 604), description: "Desperate to save their kingdom from collapse, the trolls of Zul\'Drak have turned on their ancient gods. The wild deities are now considered a source of untapped power, their potent blood providing the means to repel the Lich King\'s minions, who have overtaken parts of the troll nation. Heroes have recently journeyed to the beleaguered region to strike at the savage Drakkari and their maddened prophets.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/592?namespace=static-8.3.7_35114-eu"), id: 592, name: "Slad\'ran"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/593?namespace=static-8.3.7_35114-eu"), id: 593, name: "Drakkari Colossus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/594?namespace=static-8.3.7_35114-eu"), id: 594, name: "Moorabi"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/595?namespace=static-8.3.7_35114-eu"), id: 595, name: "Eck the Ferocious"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/596?namespace=static-8.3.7_35114-eu"), id: 596, name: "Gal\'darah")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/274?namespace=static-8.3.7_35114-eu"), id: 274), minimumLevel: 80, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 275, name: "Halls of Lightning", map: InstanceMapIndex(name: "Halls of Lightning", id: 602), description: "Upon departing Azeroth, the titans entrusted loyal protectors with safeguarding Ulduar, an enigmatic city nestled in the mountains of the Storm Peaks. Designated supreme among his brethren was the guardian known as Loken, but with the power of the titan complex in his hands, he turned to darkness and plunged the region into chaos.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/597?namespace=static-8.3.7_35114-eu"), id: 597, name: "General Bjarngrim"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/598?namespace=static-8.3.7_35114-eu"), id: 598, name: "Volkhan"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/599?namespace=static-8.3.7_35114-eu"), id: 599, name: "Ionar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/600?namespace=static-8.3.7_35114-eu"), id: 600, name: "Loken")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/275?namespace=static-8.3.7_35114-eu"), id: 275), minimumLevel: 80, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 276, name: "Halls of Reflection", map: InstanceMapIndex(name: "Halls of Reflection", id: 668), description: "For many years, champions among the races of Azeroth have stood against the Lich King only to be slaughtered mercilessly and forced to serve in his army of undead horrors. In his ongoing struggle to stop the Lich King, Tirion Fordring of the Argent Crusade has joined forces with Darion Mograine of the Knights of the Ebon Blade in order to assault Icecrown Citadel with a unified army called the Ashen Verdict.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/601?namespace=static-8.3.7_35114-eu"), id: 601, name: "Falric"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/602?namespace=static-8.3.7_35114-eu"), id: 602, name: "Marwyn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/603?namespace=static-8.3.7_35114-eu"), id: 603, name: "Escape from Arthas")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/276?namespace=static-8.3.7_35114-eu"), id: 276), minimumLevel: 80, category: InstanceCategory(type: .dungeon)),
