        InstanceJournal(id: 281, name: "The Nexus", map: InstanceMapIndex(name: "The Nexus", id: 576), description: "In order to reestablish his dominance over magic, the blue Dragon Aspect, Malygos, has launched a ruthless campaign to sever the link between mortals and the arcane energies coursing through Azeroth. To this end, his blue dragonflight is redirecting the ley lines of the world to the Nexus, Malygos\' towering lair.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/833?namespace=static-8.3.7_35114-eu"), id: 833, name: "Commander Kolurg"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/617?namespace=static-8.3.7_35114-eu"), id: 617, name: "Commander Stoutbeard"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/618?namespace=static-8.3.7_35114-eu"), id: 618, name: "Grand Magus Telestra"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/619?namespace=static-8.3.7_35114-eu"), id: 619, name: "Anomalus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/620?namespace=static-8.3.7_35114-eu"), id: 620, name: "Ormorok the Tree-Shaper"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/621?namespace=static-8.3.7_35114-eu"), id: 621, name: "Keristrasza")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/281?namespace=static-8.3.7_35114-eu"), id: 281), minimumLev