        InstanceJournal(id: 283, name: "The Violet Hold", map: InstanceMapIndex(name: "Violet Hold", id: 608), description: "Among the ornate spires and enchanted streets of Dalaran, a dark presence stirs within the mighty walls of the Violet Hold. Long used to restrain threats to the city, the tower holds row upon row of deadly inmates, and it has been diligently watched over by the Kirin Tor. However, a sudden assault has tested the integrity of the hold, putting at risk the safety of everyone outside the prison\'s walls.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/626?namespace=static-8.3.7_35114-eu"), id: 626, name: "Erekem"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/627?namespace=static-8.3.7_35114-eu"), id: 627, name: "Moragg"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/628?namespace=static-8.3.7_35114-eu"), id: 628, name: "Ichoron"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/629?namespace=static-8.3.7_35114-eu"), id: 629, name: "Xevozz"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/630?namespace=static-8.3.7_35114-eu"), id: 630, name: "Lavanthor"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/631?namespace=static-8.3.7_35114-eu"), id: 631, name: "Zuramat the Obliterator"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/632?namespace=static-8.3.7_35114-eu"), id: 632, name: "Cyanigosa")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC"