        InstanceJournal(id: 284, name: "Trial of the Champion", map: InstanceMapIndex(name: "Trial of the Champion", id: 650), description: "Clouds blanket the skies of Icecrown and heroes gather beneath battle-worn banners in preparation for the coming storm. They say that even the darkest cloud has a silver lining. It is this hope that drives the men and women of the Argent Crusade: hope that the Light will see them through these trying times, hope that good will triumph over evil, hope that a hero blessed by the Light will come forth to put an end to the Lich King\'s dark reign.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/634?namespace=static-8.3.7_35114-eu"), id: 634, name: "Grand Champions"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/834?namespace=static-8.3.7_35114-eu"), id: 834, name: "Grand Champions"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/635?namespace=static-8.3.7_35114-eu"), id: 635, name: "Eadric the Pure"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/636?namespace=static-8.3.7_35114-eu"), id: 636, name: "Argent Confessor Paletress"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/637?namespace=static-8.3.7_35114-eu"), id: 637, name: "The Black Knight")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/284?namespace=static-8.3.7_35114-eu"), id: 284), minimumLevel: 8