        InstanceJournal(id: 285, name: "Utgarde Keep", map: InstanceMapIndex(name: "Utgarde Keep", id: 574), description: "Utgarde Keep was long thought to be abandoned, a relic of a lost civilization among the central cliffs of the Howling Fjord. Yet in recent days something has roused the fortress\' slumbering residents, the vrykul.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/638?namespace=static-8.3.7_35114-eu"), id: 638, name: "Prince Keleseth"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/639?namespace=static-8.3.7_35114-eu"), id: 639, name: "Skarvald & Dalronn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/640?namespace=static-8.3.7_35114-eu"), id: 640, name: "Ingvar the Plunderer")], expansion: ExpansionIndex(id: 72, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/72?namespace=static-8.3.7_35114-eu"), name: "Wrath of the Lich King"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/285?namespace=static-8.3.7_35114-eu"), id: 285), minimumLevel: 80, category: InstanceCategory(type: .dungeon)),
