        InstanceJournal(id: 64, name: "Shadowfang Keep", map: InstanceMapIndex(name: "Shadowfang Keep", id: 33), description: "Looming over Pyrewood Village from the southern bluffs of Silverpine Forest, Shadowfang Keep casts a shadow as dark as its legacy. Sinister forces occupy these ruins, formerly the dwelling of the mad archmage Arugal\'s worgen. The restless shade of Baron Silverlaine lingers, while Lord Godfrey and his cabal of erstwhile Gilnean noblemen plot against their enemies both living and undead.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/96?namespace=static-8.3.7_35114-eu"), id: 96, name: "Baron Ashbury"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/97?namespace=static-8.3.7_35114-eu"), id: 97, name: "Baron Silverlaine"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/98?namespace=static-8.3.7_35114-eu"), id: 98, name: "Commander Springvale"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/99?namespace=static-8.3.7_35114-eu"), id: 99, name: "Lord Walden"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/100?namespace=static-8.3.7_35114-eu"), id: 100, name: "Lord Godfrey")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/64?namespace=static-8.3.7_35114-eu"), id: 64), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 65, name: "Throne of the Tides", map: InstanceMapIndex(name: "Throne of the Tides", id: 643), description: "Deep within the Abyssal Maw\'s fathomless expanses lies the Throne of the Tides. From here, the great elemental lord Neptulon the Tidehunter has surveyed and protected his aquatic domain for ages. He now faces his greatest challenge as a force of serpentine naga and malefic faceless ones threaten to depose him, leaving his realm and its secrets ripe for the plundering.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/101?namespace=static-8.3.7_35114-eu"), id: 101, name: "Lady Naz\'jar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/102?namespace=static-8.3.7_35114-eu"), id: 102, name: "Commander Ulthok, the Festering Prince"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/103?namespace=static-8.3.7_35114-eu"), id: 103, name: "Mindbender Ghur\'sha"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/104?namespace=static-8.3.7_35114-eu"), id: 104, name: "Ozumat")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/65?namespace=static-8.3.7_35114-eu"), id: 65), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 66, name: "Blackrock Caverns", map: InstanceMapIndex(name: "Blackrock Caverns", id: 645), description: "Rumors suggest that Deathwing himself carved out the subterranean labyrinth that allows the Twilight\'s Hammer to secretly transport elementals from the majestic Mount Hyjal to Blackrock Mountain. A vital hub of this shadow network is Blackrock Caverns, site of the cult\'s blistering forge and some of its most heinous experiments, including the transformation of cultists into twilight dragonkin.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/105?namespace=static-8.3.7_35114-eu"), id: 105, name: "Rom\'ogg Bonecrusher"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/106?namespace=static-8.3.7_35114-eu"), id: 106, name: "Corla, Herald of Twilight"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/107?namespace=static-8.3.7_35114-eu"), id: 107, name: "Karsh Steelbender"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/108?namespace=static-8.3.7_35114-eu"), id: 108, name: "Beauty"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/109?namespace=static-8.3.7_35114-eu"), id: 109, name: "Ascendant Lord Obsidius")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/66?namespace=static-8.3.7_35114-eu"), id: 66), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 67, name: "The Stonecore", map: InstanceMapIndex(name: "The Stonecore", id: 725), description: "Within the Temple of Earth, locked in the heart of Deepholm, lies the Stonecore. It was inside these caverns that the Twilight\'s Hammer toiled over Deathwing, hammering elementium plates to the Dragon Aspect\'s body in an attempt to hold his tormented form together. With his renewal complete, Deathwing ascended into Azeroth, shattering the World Pillar and destabilizing the region of Deepholm.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/110?namespace=static-8.3.7_35114-eu"), id: 110, name: "Corborus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/111?namespace=static-8.3.7_35114-eu"), id: 111, name: "Slabhide"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/112?namespace=static-8.3.7_35114-eu"), id: 112, name: "Ozruk"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/113?namespace=static-8.3.7_35114-eu"), id: 113, name: "High Priestess Azil")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/67?namespace=static-8.3.7_35114-eu"), id: 67), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 68, name: "The Vortex Pinnacle", map: InstanceMapIndex(name: "The Vortex Pinnacle", id: 657), description: "The Vortex Pinnacle exists within the elemental plane of Skywall. Its elegant structures, crowned with bronze and gold, sit atop platforms bridged by pure air. Yet behind its exterior beauty, the pinnacle harbors Neferset tol\'vir, as well as Al\'Akir the Windlord\'s merciless elemental legions. As long as the barrier between Skywall and Azeroth remains open, terror will rain down on Uldum from the skies.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/114?namespace=static-8.3.7_35114-eu"), id: 114, name: "Grand Vizier Ertan"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/115?namespace=static-8.3.7_35114-eu"), id: 115, name: "Altairus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/116?namespace=static-8.3.7_35114-eu"), id: 116, name: "Asaad, Caliph of Zephyrs")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/68?namespace=static-8.3.7_35114-eu"), id: 68), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 69, name: "Lost City of the Tol\'vir", map: InstanceMapIndex(name: "Lost City of the Tol\'vir", id: 755), description: "The Lost City of the Tol\'vir is the stronghold of the Neferset, a faction of the cat-like tol\'vir who swore fealty to Deathwing in exchange for a cure to the curse of flesh, which had turned their rocky hides to soft skin. With the affliction expunged, the tol\'vir have rebelled against their benefactor, although they remain irrevocably twisted and hostile due to the dark pact that they made.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/117?namespace=static-8.3.7_35114-eu"), id: 117, name: "General Husam"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/118?namespace=static-8.3.7_35114-eu"), id: 118, name: "Lockmaw"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/119?namespace=static-8.3.7_35114-eu"), id: 119, name: "High Prophet Barim"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/122?namespace=static-8.3.7_35114-eu"), id: 122, name: "Siamat")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/69?namespace=static-8.3.7_35114-eu"), id: 69), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 70, name: "Halls of Origination", map: InstanceMapIndex(name: "Halls of Origination", id: 644), description: "Constructed by the great titans, the Halls of Origination are filled with ancient relics and the fearsome guardians that protect them. Rumors abound that the complex also contains a devastating weapon capable of reordering all life on Azeroth. Deathwing has moved to obtain this terrifying device through his agent, Al\'Akir the Windlord. Thus far the facility\'s communication systems have been fully corrupted, but the weapon inside continues to elude Deathwing\'s grasp.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/124?namespace=static-8.3.7_35114-eu"), id: 124, name: "Temple Guardian Anhuur"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/125?namespace=static-8.3.7_35114-eu"), id: 125, name: "Earthrager Ptah"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/126?namespace=static-8.3.7_35114-eu"), id: 126, name: "Anraphet"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/127?namespace=static-8.3.7_35114-eu"), id: 127, name: "Isiset, Construct of Magic"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/128?namespace=static-8.3.7_35114-eu"), id: 128, name: "Ammunae, Construct of Life"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/129?namespace=static-8.3.7_35114-eu"), id: 129, name: "Setesh, Construct of Destruction"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/130?namespace=static-8.3.7_35114-eu"), id: 130, name: "Rajh, Construct of Sun")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/70?namespace=static-8.3.7_35114-eu"), id: 70), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 71, name: "Grim Batol", map: InstanceMapIndex(name: "Grim Batol", id: 670), description: "Don\'t be fooled by Grim Batol\'s humble exterior; many of this mountain fortress\'s desecrated chambers are buried deep in the Twilight Highlands. Once the stronghold of the Wildhammer dwarves, and later seized by orcs as a prison for Alextrasza, the city is now in the clutches of the Twilight\'s Hammer cult.\r\n\r\nHeroes brave enough to infiltrate the brooding depths of the stronghold must confront Deathwing\'s agents to thwart the mysterious evil within.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/131?namespace=static-8.3.7_35114-eu"), id: 131, name: "General Umbriss"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/132?namespace=static-8.3.7_35114-eu"), id: 132, name: "Forgemaster Throngus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/133?namespace=static-8.3.7_35114-eu"), id: 133, name: "Drahga Shadowburner"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/134?namespace=static-8.3.7_35114-eu"), id: 134, name: "Erudax, the Duke of Below")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/71?namespace=static-8.3.7_35114-eu"), id: 71), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 76, name: "Zul\'Gurub", map: InstanceMapIndex(name: "Zul\'Gurub", id: 859), description: "Zul\'Gurub was the capital of the Gurubashi jungle trolls, a tribe that once controlled the vast jungles of the south. It was here that Jin\'do the Hexxer summoned the savage loa Hakkar the Soulflayer into Azeroth. Of late, these efforts have begun anew amid an alliance between the Gurubashi and Zandalar trolls that seeks to establish a unified troll empire.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/175?namespace=static-8.3.7_35114-eu"), id: 175, name: "High Priest Venoxis"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/176?namespace=static-8.3.7_35114-eu"), id: 176, name: "Bloodlord Mandokir"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/177?namespace=static-8.3.7_35114-eu"), id: 177, name: "Cache of Madness - Gri\'lek"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/178?namespace=static-8.3.7_35114-eu"), id: 178, name: "Cache of Madness - Hazza\'rah"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/179?namespace=static-8.3.7_35114-eu"), id: 179, name: "Cache of Madness - Renataki"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/180?namespace=static-8.3.7_35114-eu"), id: 180, name: "Cache of Madness - Wushoolay"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/181?namespace=static-8.3.7_35114-eu"), id: 181, name: "High Priestess Kilnara"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/184?namespace=static-8.3.7_35114-eu"), id: 184, name: "Zanzil"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/185?namespace=static-8.3.7_35114-eu"), id: 185, name: "Jin\'do the Godbreaker")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/76?namespace=static-8.3.7_35114-eu"), id: 76), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 77, name: "Zul\'Aman", map: InstanceMapIndex(name: "Zul\'Aman", id: 568), description: "Echoes of unfulfilled vengeance linger in the one-time capital of the Amani tribe, Zul\'Aman. Though the Amani trolls answered their warlord\'s call to arms, Zul\'jin was denied his goal of restoring the empire to its former glory. Where he failed, the Zandalar tribe will succeed. Left unchecked, the united tribes will reclaim their lands and savor a merciless retribution.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/186?namespace=static-8.3.7_35114-eu"), id: 186, name: "Akil\'zon"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/187?namespace=static-8.3.7_35114-eu"), id: 187, name: "Nalorakk"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/188?namespace=static-8.3.7_35114-eu"), id: 188, name: "Jan\'alai"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/189?namespace=static-8.3.7_35114-eu"), id: 189, name: "Halazzi"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/190?namespace=static-8.3.7_35114-eu"), id: 190, name: "Hex Lord Malacrass"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/191?namespace=static-8.3.7_35114-eu"), id: 191, name: "Daakara")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/77?namespace=static-8.3.7_35114-eu"), id: 77), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 184, name: "End Time", map: InstanceMapIndex(name: "End Time", id: 938), description: "One of an infinite number of potential outcomes, this timeway depicts the desolate future of Azeroth should Deathwing fail to be stopped.  Nozdormu has identified a powerful anomaly that exists in this moment and bars access to the past - and hope of retrieving the Demon Soul. The powerful creature from out of time lives alone amidst the time-twisted echoes of the past.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/340?namespace=static-8.3.7_35114-eu"), id: 340, name: "Echo of Baine"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/285?namespace=static-8.3.7_35114-eu"), id: 285, name: "Echo of Jaina"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/323?namespace=static-8.3.7_35114-eu"), id: 323, name: "Echo of Sylvanas"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/283?namespace=static-8.3.7_35114-eu"), id: 283, name: "Echo of Tyrande"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/289?namespace=static-8.3.7_35114-eu"), id: 289, name: "Murozond")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/184?namespace=static-8.3.7_35114-eu"), id: 184), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 185, name: "Well of Eternity", map: InstanceMapIndex(name: "Well of Eternity", id: 939), description: "Ten-thousand years in the past, the night elven capital city of Zin-Azshari was a magnificent, sparkling metropolis.  Situated on the shores of the Well of Eternity, it was here that the aristocratic Highborne first opened a portal into the Twisting Nether and invited the Burning Legion to invade Azeroth.  Under the command of the night elven queen, Azshara, they now pour their energies into the portal, preparing it for the terrifying and glorious entrance of the demon god Sargeras.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/290?namespace=static-8.3.7_35114-eu"), id: 290, name: "Peroth\'arn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/291?namespace=static-8.3.7_35114-eu"), id: 291, name: "Queen Azshara"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/292?namespace=static-8.3.7_35114-eu"), id: 292, name: "Mannoroth and Varo\'then")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/185?namespace=static-8.3.7_35114-eu"), id: 185), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 186, name: "Hour of Twilight", map: InstanceMapIndex(name: "Hour of Twilight", id: 940), description: "With the Dragon Soul retrieved from the past, the Heroes of Azeroth now prepare for the final confrontation with Deathwing.  In the frozen wastes of Northrend, the towering spire of Wyrmrest Temple is under the assault of Deathwing\'s Twilight forces.  In order to save Azeroth, Thrall must arrive safely at the temple with the Dragon Soul in hand.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/322?namespace=static-8.3.7_35114-eu"), id: 322, name: "Arcurion"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/342?namespace=static-8.3.7_35114-eu"), id: 342, name: "Asira Dawnslayer"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/341?namespace=static-8.3.7_35114-eu"), id: 341, name: "Archbishop Benedictus")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/186?namespace=static-8.3.7_35114-eu"), id: 186), minimumLevel: 85, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 302, name: "Stormstout Brewery", map: InstanceMapIndex(name: "Stormstout Brewery", id: 961), description: "When Chen Stormstout arrived in the Valley of the Four Winds, he journeyed to the renowned brewery of his namesake, hoping to connect with his relatives. What he found was his ancestral home in disarray. Under the watch of the incompetent Uncle Gao, loathsome virmen and unruly hozen have infiltrated the brewery, sparking a destructive revel that will soon devastate the region\'s supply of tasty brews.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/668?namespace=static-8.3.7_35114-eu"), id: 668, name: "Ook-Ook"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/669?namespace=static-8.3.7_35114-eu"), id: 669, name: "Hoptallus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/670?namespace=static-8.3.7_35114-eu"), id: 670, name: "Yan-Zhu the Uncasked")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/302?namespace=static-8.3.7_35114-eu"), id: 302), minimumLevel: 90, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 303, name: "Gate of the Setting Sun", map: InstanceMapIndex(name: "Gate of the Setting Sun", id: 962), description: "For generations, a massive wall called the Serpent\'s Spine has protected the denizens of Pandaria from periodic assaults by the rampaging, insect-like mantid. This brutal race\'s cycle of aggression recently began earlier than expected, catching the wall\'s defenders off guard. As the mightiest mantid warriors charge the battle-worn gates, Pandaria must hold back the most devastating army in the land\'s recorded history.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/655?namespace=static-8.3.7_35114-eu"), id: 655, name: "Saboteur Kip\'tilak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/675?namespace=static-8.3.7_35114-eu"), id: 675, name: "Striker Ga\'dok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/676?namespace=static-8.3.7_35114-eu"), id: 676, name: "Commander Ri\'mok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/649?namespace=static-8.3.7_35114-eu"), id: 649, name: "Raigonn")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/303?namespace=static-8.3.7_35114-eu"), id: 303), minimumLevel: 90, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 312, name: "Shado-Pan Monastery", map: InstanceMapIndex(name: "Shado-Pan Monastery", id: 959), description: "War has spread across Pandaria, and the destructive conflict between the Horde and Alliance has led to turmoil in the majestic Shado-Pan Monastery. There, three malevolent entities--the Sha of Violence, the Sha of Hatred, and the Sha of Anger--have erupted from their prisons. Although the Sha of Anger fled the secluded monastery completely, the remaining sha have begun wreaking havoc on the site\'s brave Shado-Pan defenders.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/673?namespace=static-8.3.7_35114-eu"), id: 673, name: "Gu Cloudstrike"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/657?namespace=static-8.3.7_35114-eu"), id: 657, name: "Master Snowdrift"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/685?namespace=static-8.3.7_35114-eu"), id: 685, name: "Sha of Violence"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/686?namespace=static-8.3.7_35114-eu"), id: 686, name: "Taran Zhu")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/312?namespace=static-8.3.7_35114-eu"), id: 312), minimumLevel: 90, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 313, name: "Temple of the Jade Serpent", map: InstanceMapIndex(name: "Temple of the Jade Serpent", id: 960), description: "Rising high above the east coast of Pandaria, the Temple of the Jade Serpent stands as a sacred monument to the legendary pandaren emperor Shaohao\'s victory over the Sha of Doubt thousands of years ago. Recently, a disastrous conflict in the Jade Forest unleashed the sha, and several of the entities  have raided the temple\'s most treasured stores of wisdom and knowledge.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/672?namespace=static-8.3.7_35114-eu"), id: 672, name: "Wise Mari"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/664?namespace=static-8.3.7_35114-eu"), id: 664, name: "Lorewalker Stonestep"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/658?namespace=static-8.3.7_35114-eu"), id: 658, name: "Liu Flameheart"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/335?namespace=static-8.3.7_35114-eu"), id: 335, name: "Sha of Doubt")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/313?namespace=static-8.3.7_35114-eu"), id: 313), minimumLevel: 90, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 321, name: "Mogu\'shan Palace", map: InstanceMapIndex(name: "Mogu\'shan Palace", id: 994), description: "The ancient Mogu\'shan Palace is the last true bastion of mogu strength on mainland Pandaria. Three of their great clans recently gathered at this stunning location to meet with their king, Xin the Weaponmaster. This mighty ruler has formulated a bold plan to unite his scattered people and reclaim the glory of their fallen empire. With turmoil gripping Pandaria, Xin\'s lofty dream of conquest could become reality.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/708?namespace=static-8.3.7_35114-eu"), id: 708, name: "Trial of the King"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/690?namespace=static-8.3.7_35114-eu"), id: 690, name: "Gekkan"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/698?namespace=static-8.3.7_35114-eu"), id: 698, name: "Xin the Weaponmaster")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/321?namespace=static-8.3.7_35114-eu"), id: 321), minimumLevel: 90, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 324, name: "Siege of Niuzao Temple", map: InstanceMapIndex(name: "Siege of Niuzao Temple", id: 1011), description: "Niuzao Temple extends across two fortified islands far beyond a towering wall called the Serpent\'s Spine. For years, tenacious pandaren defenders have protected the narrow bridges connecting the isles, staving off any would-be invaders. Yet recently, the mantid created their own bridge--a massive tree root--and seized one of the islands by surprise. Now, these brutal insectoids are poised to assault Niuzao\'s remaining guardians.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/693?namespace=static-8.3.7_35114-eu"), id: 693, name: "Vizier Jin\'bak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/738?namespace=static-8.3.7_35114-eu"), id: 738, name: "Commander Vo\'jak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/692?namespace=static-8.3.7_35114-eu"), id: 692, name: "General Pa\'valak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/727?namespace=static-8.3.7_35114-eu"), id: 727, name: "Wing Leader Ner\'onok")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/324?namespace=static-8.3.7_35114-eu"), id: 324), minimumLevel: 90, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 385, name: "Bloodmaul Slag Mines", map: InstanceMapIndex(name: "Bloodmaul Slag Mines", id: 1175), description: "On the northern outskirts of Frostfire Ridge, the Bloodmaul ogres run a brutal mining operation amidst the sweltering heat of active volcanic caverns. Slaves from across Draenor are transported to the mines, never to leave alive. The Slag Mines produce abundant yields of gemstones and ore, but it is rumored that the true purpose of these mines is to dig for an ancient relic of immense power.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/893?namespace=static-8.3.7_35114-eu"), id: 893, name: "Magmolatus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/888?namespace=static-8.3.7_35114-eu"), id: 888, name: "Slave Watcher Crushto"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/887?namespace=static-8.3.7_35114-eu"), id: 887, name: "Roltall"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/889?namespace=static-8.3.7_35114-eu"), id: 889, name: "Gug\'rokk")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/385?namespace=static-8.3.7_35114-eu"), id: 385), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 476, name: "Skyreach", map: InstanceMapIndex(name: "Skyreach", id: 1209), description: "Atop the crowning pinnacle of the Spires of Arak, amidst the clouds, Skyreach stands as the seat of power of the Adherents of Rukhmar. The arakkoa have gathered and harnessed the Apexis technology of their forebears, and now they are ready to unleash the focused power of the sun upon their enemies.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/965?namespace=static-8.3.7_35114-eu"), id: 965, name: "Ranjit"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/966?namespace=static-8.3.7_35114-eu"), id: 966, name: "Araknath"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/967?namespace=static-8.3.7_35114-eu"), id: 967, name: "Rukhran"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/968?namespace=static-8.3.7_35114-eu"), id: 968, name: "High Sage Viryx")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/476?namespace=static-8.3.7_35114-eu"), id: 476), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 536, name: "Grimrail Depot", map: InstanceMapIndex(name: "Grimrail Depot", id: 1208), description: "The Grimrail Depot is a vital hub in the Iron Horde war machine, allowing for the transport of troops and materiel produced in the Blackrock Foundry to the front lines of the war being waged across Draenor. The Depot\'s namesake is the Grimrail itself, a massive train that can bear entire battalions of troops and artillery. On this day, the Grimrail has been fitted with a massive railgun powerful enough to shatter the shield protecting Shattrath, and is about to depart....", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1138?namespace=static-8.3.7_35114-eu"), id: 1138, name: "Rocketspark and Borka"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1163?namespace=static-8.3.7_35114-eu"), id: 1163, name: "Nitrogg Thundertower"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1133?namespace=static-8.3.7_35114-eu"), id: 1133, name: "Skylord Tovra")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/536?namespace=static-8.3.7_35114-eu"), id: 536), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 537, name: "Shadowmoon Burial Grounds", map: InstanceMapIndex(name: "Shadowmoon Burial Grounds", id: 1176), description: "The traditional burial grounds of the Shadowmoon clan are the final resting place for countless generations of ancestors. The fallen chieftain Ner\'zhul, in the depths of his depravity, has sacrificed the very soul of his clan in a desperate quest for power. Now the ancestral spirits are restless, tormented and used to fuel dark rituals that will pull all of Draenor into the void if allowed to run their course.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1139?namespace=static-8.3.7_35114-eu"), id: 1139, name: "Sadana Bloodfury"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1168?namespace=static-8.3.7_35114-eu"), id: 1168, name: "Nhallish"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1140?namespace=static-8.3.7_35114-eu"), id: 1140, name: "Bonemaw"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1160?namespace=static-8.3.7_35114-eu"), id: 1160, name: "Ner\'zhul")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/537?namespace=static-8.3.7_35114-eu"), id: 537), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 547, name: "Auchindoun", map: InstanceMapIndex(name: "Auchindoun", id: 1182), description: "Auchindoun is the holy mausoleum of the draenei, a sanctum of the Light in which the spirits of the dead find respite. The crystalline structure also serves to protect and shield draenei souls from their eternal enemies: the Burning Legion, who hunger eternally for draenei spirits. This fact makes it a location of particular interest to Gul\'dan and his Shadow Council, who seek to gain favor with their demonic masters.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1185?namespace=static-8.3.7_35114-eu"), id: 1185, name: "Vigilant Kaathar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1186?namespace=static-8.3.7_35114-eu"), id: 1186, name: "Soulbinder Nyami"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1216?namespace=static-8.3.7_35114-eu"), id: 1216, name: "Azzakel"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1225?namespace=static-8.3.7_35114-eu"), id: 1225, name: "Teron\'gor")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/547?namespace=static-8.3.7_35114-eu"), id: 547), minimumLevel: 999, catego