        InstanceJournal(id: 556, name: "The Everbloom", map: InstanceMapIndex(name: "The Everbloom", id: 1279), description: "After the disruption of the Dark Portal, the Kirin Tor realized that to fight the Iron Horde on their own soil, they would need a supply line for reinforcements. Thus, they created outposts across Draenor with magical links back to Azeroth. Unfortunately, what seemed like a prime strategic location near the Blackrock Foundry was known to the botani as The Everbloom, a sacred place within the Gorgrond woodlands. The outpost was quickly overgrown, but it still contains a link to the outskirts of Stormwind....", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1214?namespace=static-8.3.7_35114-eu"), id: 1214, name: "Witherbark"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1207?namespace=static-8.3.7_35114-eu"), id: 1207, name: "Ancient Protectors"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1208?namespace=static-8.3.7_35114-eu"), id: 1208, name: "Archmage Sol"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1209?namespace=static-8.3.7_35114-eu"), id: 1209, name: "Xeri\'tac"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1210?namespace=static-8.3.7_35114-eu"), id: 1210, name: "Yalnu")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYT