        InstanceJournal(id: 558, name: "Iron Docks", map: InstanceMapIndex(name: "Iron Docks", id: 1195), description: "On the northern coast of Gorgrond, the Iron Docks represent the heart of the Iron Horde\'s naval might. Huge warships and artillery, forged and assembled within the Blackrock Foundry, are readied for war within this massive port. The greatest beasts of Draenor are broken and trained alongside elite infantry units, comprising the ground troops that will surge ashore to break the will of any who would dare oppose the Iron Horde.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1235?namespace=static-8.3.7_35114-eu"), id: 1235, name: "Fleshrender Nok\'gar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1236?namespace=static-8.3.7_35114-eu"), id: 1236, name: "Grimrail Enforcers"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1237?namespace=static-8.3.7_35114-eu"), id: 1237, name: "Oshir"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1238?namespace=static-8.3.7_35114-eu"), id: 1238, name: "Skulloc")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/558?namespace=static-8.3.7_35114-eu"), id: 558), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 559, name: "Upper Blackrock Spire", map: InstanceMapIndex(name: "Upper Blackrock Spire", id: 1358), description: "The history of this imposing fortress is long and complex. Carved into the fiery core of Blackrock Mountain by the Dark Iron clan centuries ago, and eventually taken by the black dragon Nefarian and his brood, the upper reaches of Blackrock Spire are now home to the Ironmarch vanguard. As preparations to use the Spire as the staging ground for a full-scale invasion of Azeroth continue, the Iron Horde has set up a terrifying contingency plan: a doomsday weapon within the heart of Blackrock Mountain.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1226?namespace=static-8.3.7_35114-eu"), id: 1226, name: "Orebender Gor\'ashan"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1227?namespace=static-8.3.7_35114-eu"), id: 1227, name: "Kyrak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1228?namespace=static-8.3.7_35114-eu"), id: 1228, name: "Commander Tharbek"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1229?namespace=static-8.3.7_35114-eu"), id: 1229, name: "Ragewing the Untamed"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1234?namespace=static-8.3.7_35114-eu"), id: 1234, name: "Warlord Zaela")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/559?namespace=static-8.3.7_35114-eu"), id: 559), minimumLevel: 999, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 707, name: "Vault of the Wardens", map: InstanceMapIndex(name: "Vault of the Wardens", id: 1493), description: "This secret Warden facility was carved into the mountainside deep in Azsuna, and sealed with magical wards both to keep intruders out, and to ensure that the terrors locked within could never escape. Many of the most dangerous foes the Wardens have encountered were locked away within the Vault, but in the aftermath of Cordana\'s betrayal and the Legion\'s attack, those creatures now roam the halls freely.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1467?namespace=static-8.3.7_35114-eu"), id: 1467, name: "Tirathon Saltheril"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1695?namespace=static-8.3.7_35114-eu"), id: 1695, name: "Inquisitor Tormentorum"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1468?namespace=static-8.3.7_35114-eu"), id: 1468, name: "Ash\'golm"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1469?namespace=static-8.3.7_35114-eu"), id: 1469, name: "Glazer"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1470?namespace=static-8.3.7_35114-eu"), id: 1470, name: "Cordana Felsong")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/707?namespace=static-8.3.7_35114-eu"), id: 707), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 716, name: "Eye of Azshara", map: InstanceMapIndex(name: "Eye of Azshara", id: 1456), description: "Amidst outlying shoals off the coast of Azsuna, an ancient source of power lies beneath the waves. Long ago, the power of Queen Azshara extended throughout these lands, and the naga seeking the Tidestone of Golganneth still act at her behest. As clouds roll in and the air crackles with the energy of an approaching storm, Azshara\'s followers prepare to summon an incarnation of her Wrath to lay waste to the land.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1480?namespace=static-8.3.7_35114-eu"), id: 1480, name: "Warlord Parjesh"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1490?namespace=static-8.3.7_35114-eu"), id: 1490, name: "Lady Hatecoil"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1491?namespace=static-8.3.7_35114-eu"), id: 1491, name: "King Deepbeard"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1479?namespace=static-8.3.7_35114-eu"), id: 1479, name: "Serpentrix"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1492?namespace=static-8.3.7_35114-eu"), id: 1492, name: "Wrath of Azshara")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/716?namespace=static-8.3.7_35114-eu"), id: 716), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 721, name: "Halls of Valor", map: InstanceMapIndex(name: "Halls of Valor", id: 1477), description: "In the clouds high above Stormheim, the titanic keeper Odyn has called the greatest vrykul warriors of Azeroth to be his Valarjar. Amidst feasting halls and hunting grounds, these ascended vrykul test themselves and prepare for the great war that is to come. Adventurers must pass through these halls and prove their worth if they hope to stand before Odyn and claim the Aegis of Aggramar.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1485?namespace=static-8.3.7_35114-eu"), id: 1485, name: "Hymdall"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1486?namespace=static-8.3.7_35114-eu"), id: 1486, name: "Hyrja"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1487?namespace=static-8.3.7_35114-eu"), id: 1487, name: "Fenryr"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1488?namespace=static-8.3.7_35114-eu"), id: 1488, name: "God-King Skovald"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1489?namespace=static-8.3.7_35114-eu"), id: 1489, name: "Odyn")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/dat