        InstanceJournal(id: 726, name: "The Arcway", map: InstanceMapIndex(name: "The Arcway", id: 1516), description: "As vast as the city of Suramar is, the vast network of tunnels beneath the city spans an even greater reach. Nightborne society has grown to depend on the power of the Nightwell, and the Arcway delivers that lifeblood throughout the city. This labyrinthine complex was built thousands of years ago, running beneath the foundations of the city\'s largest buildings, and most modern citizens live their lives entirely unaware of what may lurk in the shadows beneath their feet....", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1497?namespace=static-8.3.7_35114-eu"), id: 1497, name: "Ivanyr"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1498?namespace=static-8.3.7_35114-eu"), id: 1498, name: "Corstilax"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1499?namespace=static-8.3.7_35114-eu"), id: 1499, name: "General Xakal"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1500?namespace=static-8.3.7_35114-eu"), id: 1500, name: "Nal\'tira"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1501?namespace=static-8.3.7_35114-eu"), id: 1501, name: "Advisor Vandros")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/726?namespace=static-8.3.7_35114-eu"), id: 726), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 727, name: "Maw of Souls", map: InstanceMapIndex(name: "Maw of Souls", id: 1492), description: "While the greatest vrykul warriors are spirited away to the Halls of Valor to glory eternal, shiny and gold, the cursed and the damned find themselves on the shores of the Maw of Souls. Amidst fog and mist, they await the Naglfar, a fearsome ship formed from sinew and bone, which comes to deliver these poor souls to Helheim, and the clutches of Helya.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1502?namespace=static-8.3.7_35114-eu"), id: 1502, name: "Ymiron, the Fallen King"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1512?namespace=static-8.3.7_35114-eu"), id: 1512, name: "Harbaron"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1663?namespace=static-8.3.7_35114-eu"), id: 1663, name: "Helya")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/727?namespace=static-8.3.7_35114-eu"), id: 727), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 740, name: "Black Rook Hold", map: InstanceMapIndex(name: "Black Rook Hold", id: 1501), description: "Carved from the greatest mountain of Val\'sharah by ancient elven masons, Black Rook Hold stood as a bulwark against the Burning Legion during the War of the Ancients. The nigh-impregnable fortress is also the ancestral home of Lord Kur\'talos Ravencrest, one-time mentor of Illidan himself. But since the latest Legion attack, a strange dark energy emanates from the Hold, and restless dead plague the surrounding lands.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1518?namespace=static-8.3.7_35114-eu"), id: 1518, name: "The Amalgam of Souls"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1653?namespace=static-8.3.7_35114-eu"), id: 1653, name: "Illysanna Ravencrest"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1664?namespace=static-8.3.7_35114-eu"), id: 1664, name: "Smashspite the Hateful"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1672?namespace=static-8.3.7_35114-eu"), id: 1672, name: "Lord Kur\'talos Ravencrest")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/740?namespace=static-8.3.7_35114-eu"), 