        InstanceJournal(id: 762, name: "Darkheart Thicket", map: InstanceMapIndex(name: "Darkheart Thicket", id: 1466), description: "In the shadow of Shaladrassil, the Nightmare permeates every inch of the once-lush forest. Where the eldest and greatest druids once tended to the woods, meditating beneath the great world tree, corruption and madness now reign. Deep within the tangled thicket, the Nightmare Lord Xavius works to break the will of his greatest prize.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1654?namespace=static-8.3.7_35114-eu"), id: 1654, name: "Archdruid Glaidalis"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1655?namespace=static-8.3.7_35114-eu"), id: 1655, name: "Oakheart"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1656?namespace=static-8.3.7_35114-eu"), id: 1656, name: "Dresaron"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1657?namespace=static-8.3.7_35114-eu"), id: 1657, name: "Shade of Xavius")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/762?namespace=static-8.3.7_35114-eu"), id: 762), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 767, name: "Neltharion\'s Lair", map: InstanceMapIndex(name: "Neltharion\'s Lair", id: 1458), description: "The Earth Warder Neltharion, later known as Deathwing, once called this cavern home. Since his fall, the drogbar that once worshipped the great dragon built their capital within this ancient lair. Now, Dargrul, chieftain of the drogbar, rallies a massive army within these depths. Bolstered by the Hammer of Khaz\'goroth, this army will surge from the mountainside if left unchecked, devastating Highmountain and threatening the security of all Azeroth.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1662?namespace=static-8.3.7_35114-eu"), id: 1662, name: "Rokmora"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1665?namespace=static-8.3.7_35114-eu"), id: 1665, name: "Ularogg Cragshaper"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1673?namespace=static-8.3.7_35114-eu"), id: 1673, name: "Naraxas"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1687?namespace=static-8.3.7_35114-eu"), id: 1687, name: "Dargrul the Underking")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/767?namespace=static-8.3.7_35114-eu"