        InstanceJournal(id: 777, name: "Assault on Violet Hold", map: InstanceMapIndex(name: "Assault on Violet Hold", id: 1544), description: "In the aftermath of the Northrend campaign and the Blue Dragonflight\'s attack on this Dalaran prison, the Violet Hold was repaired and its cells were repurposed to house some of the most dangerous servants of the Lich King. Now, as Dalaran floats above the Broken Isles as the flagship of the war against the Legion, a shadowy threat once again seeks to strike at Kirin Tor from within.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1702?namespace=static-8.3.7_35114-eu"), id: 1702, name: "Blood-Princess Thal\'ena"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1693?namespace=static-8.3.7_35114-eu"), id: 1693, name: "Festerface"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1694?namespace=static-8.3.7_35114-eu"), id: 1694, name: "Shivermaw"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1696?namespace=static-8.3.7_35114-eu"), id: 1696, name: "Anub\'esset"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1688?namespace=static-8.3.7_35114-eu"), id: 1688, name: "Millificent Manastorm"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1686?namespace=static-8.3.7_35114-eu"), id: 1686, name: "Mindflayer Kaahrj"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1711?namespace=static-8.3.7_35114-eu"), id: 1711, name: "Fel Lord Betrug"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1697?namespace=static-8.3.7_35114-eu"), id: 1697, name: "Sael\'orn")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?names