        InstanceJournal(id: 800, name: "Court of Stars", map: InstanceMapIndex(name: "Court of Stars", id: 1571), description: "Even as Legion troops patrol the streets, casting a pall over the grand city of Suramar, the socialites of the Nightborne nobility continue to cling to custom and routine. On this clear night, the cry of revelers echoes through the chill air, as the largest mansion in the Noble District opens its doors for a grand gala. Rumor has it that Grand Magistrix Elisande herself may be making an appearance, in an effort to reassure several of her closest allies despite recent turmoil.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1718?namespace=static-8.3.7_35114-eu"), id: 1718, name: "Patrol Captain Gerdo"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1719?namespace=static-8.3.7_35114-eu"), id: 1719, name: "Talixae Flamewreath"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1720?namespace=static-8.3.7_35114-eu"), id: 1720, name: "Advisor Melandrus")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/800?namespace=static-8.3.7_35114-eu"), id: 800), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 860, name: "Return to Karazhan", map: InstanceMapIndex(name: "Return to Karazhan", id: 1651), description: "From the moment of its mysterious creation, the purpose of this dark tower has been intertwined with the history of the Guardians of Tirisfal, once Azeroth\'s greatest bulwark against the Legion. It is now best known as the home of Medivh, who tragically betrayed Azeroth and brought the unbroken chain of Guardians to an end. This legacy makes Karazhan a place of particular interest for the Legion, who have descended in full force in an effort to open a new front in their war on the denizens of Azeroth.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1820?namespace=static-8.3.7_35114-eu"), id: 1820, name: "Opera Hall: Wikket"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1826?namespace=static-8.3.7_35114-eu"), id: 1826, name: "Opera Hall: Westfall Story"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1827?namespace=static-8.3.7_35114-eu"), id: 1827, name: "Opera Hall: Beautiful Beast"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1825?namespace=static-8.3.7_35114-eu"), id: 1825, name: "Maiden of Virtue"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1835?namespace=static-8.3.7_35114-eu"), id: 1835, name: "Attumen the Huntsman"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1837?namespace=static-8.3.7_35114-eu"), id: 1837, name: "Moroes"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1836?namespace=static-8.3.7_35114-eu"), id: 1836, name: "The Curator"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1817?namespace=static-8.3.7_35114-eu"), id: 1817, name: "Shade of Medivh"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1818?namespace=static-8.3.7_35114-eu"), id: 1818, name: "Mana Devourer"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1838?namespace=static-8.3.7_35114-eu"), id: 1838, name: "Viz\'aduum the Watcher")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/860?namespace=static-8.3.7_35114-eu"), id: 860), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 900, name: "Cathedral of Eternal Night", map: InstanceMapIndex(name: "Cathedral of Eternal Night", id: 1677), description: "The upper chambers of the Tomb of Sargeras were once a place of worship to Elune. Since the Legion\'s invasion, fel minions have desecrated this holy place, twisting it into their own image. Now, this site will host a battle that could turn the tide of the invasion. While the Armies of Legionfall engage the fel army directly, a small group of heroes infiltrates the upper reaches of the cathedral in a desperate hope to return the Aegis of Aggramar to its resting place.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1905?namespace=static-8.3.7_35114-eu"), id: 1905, name: "Agronox"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1906?namespace=static-8.3.7_35114-eu"), id: 1906, name: "Thrashbite the Scornful"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1904?namespace=static-8.3.7_35114-eu"), id: 1904, name: "Domatrax"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1878?namespace=static-8.3.7_35114-eu"), id: 1878, name: "Mephistroth")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/900?namespace=static-8.3.7_35114-eu"), id: 900), minimumLevel: 110, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 945, name: "Seat of the Triumvirate", map: InstanceMapIndex(name: "Seat of the Triumvirate", id: 1753), description: "Argus was governed from the gleaming halls of the Seat of the Triumvirate--until the eredar struck their unholy bargain with Sargeras. Enraged by Velen\'s defiant exodus, Kil\'jaeden decreed that the Seat should be abandoned as a symbol of an irrelevant past... for the Legion had become their future.\r\n\r\nIts once-gleaming halls now fallen into shadow, the Seat radiates a dark power that has drawn those seeking to harness the might of the Void and unleash it upon their enemies.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1979?namespace=static-8.3.7_35114-eu"), id: 1979, name: "Zuraal the Ascended"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1980?namespace=static-8.3.7_35114-eu"), id: 1980, name: "Saprish"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1981?namespace=static-8.3.7_35114-eu"), id: 1981, name: "Viceroy Nezhar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1982?namespace=static-8.3.7_35114-eu"), id: 1982, name: "L\'ura")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/945?namespace=static-8.3.7_35114-eu"), id: 945), minimumLevel: 110, category: InstanceCategory(type: 