        InstanceJournal(id: 968, name: "Atal\'Dazar", map: InstanceMapIndex(name: "Atal\'Dazar", id: 1763), description: "For millennia, the Zandalari kings were laid to rest within the tombs of Atal\'Dazar, secluded high atop the mountain Mugamba. These pyramids grew more elaborate with each passing ruler, as new rooms were constructed to house the deceased\'s vast wealth. Now, these once pristine halls have been corrupted by the Prophet Zul and his trusted lieutenant, Yazma, who seek to twist the power of these ancient kings for their own dark machinations.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2082?namespace=static-8.3.7_35114-eu"), id: 2082, name: "Priestess Alun\'za"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2036?namespace=static-8.3.7_35114-eu"), id: 2036, name: "Vol\'kaal"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2083?namespace=static-8.3.7_35114-eu"), id: 2083, name: "Rezan"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2030?namespace=static-8.3.7_35114-eu"), id: 2030, name: "Yazma")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/968?namespace=static-8.3.7_35114-eu"), id: 968), minimumLevel: 1