        InstanceJournal(id: 1001, name: "Freehold", map: InstanceMapIndex(name: "Freehold", id: 1754), description: "Freehold has traditionally served as a haven for pirates, scoundrels, and those who wish to live free of Kul Tiran control. Now, the Irontide Raiders have brought the city under their harsh rule and are coercing the various pirate crews under their banner. While the pirates gather, a small group of heroes must infiltrate the town and eliminate their leadership to dissolve this growing alliance of cutthroats.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2102?namespace=static-8.3.7_35114-eu"), id: 2102, name: "Skycap\'n Kragg"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2093?namespace=static-8.3.7_35114-eu"), id: 2093, name: "Council o\' Captains"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2094?namespace=static-8.3.7_35114-eu"), id: 2094, name: "Ring of Booty"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2095?namespace=static-8.3.7_35114-eu"), id: 2095, name: "Harlan Sweete")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1001?namespace=static-8.3.7_35114-eu"), id: 1001), minimumLevel: 120, categor