        InstanceJournal(id: 1002, name: "Tol Dagor", map: InstanceMapIndex(name: "Tol Dagor", id: 1771), description: "Once a highly maintained prison, Tol Dagor has since been purchased and run by the Ashvane Company. Now, it serves as indefinite holding for any who would oppose the Ashvane Trading Company.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2097?namespace=static-8.3.7_35114-eu"), id: 2097, name: "The Sand Queen"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2098?namespace=static-8.3.7_35114-eu"), id: 2098, name: "Jes Howlis"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2099?namespace=static-8.3.7_35114-eu"), id: 2099, name: "Knight Captain Valyri"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2096?namespace=static-8.3.7_35114-eu"), id: 2096, name: "Overseer Korgus")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1002?namespace=static-8.3.7_35114-eu"), id: 1002), minimumLevel: 120, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 1012, name: "The MOTHERLODE!!", map: InstanceMapIndex(name: "The MOTHERLODE!!", id: 1594), description: "The Isle of Kezan, rent asunder by the eruption of Mount Kajaro, is now brimming with Azerite in the aftermath of Sargeras\' assault on Azeroth. Seeking to make a fortune and stake his claim to the title of Trade Prince, Mogul Razdunk has focused the Venture Company\'s efforts on weaponizing Azerite and selling it to the highest bidder.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2109?namespace=static-8.3.7_35114-eu"), id: 2109, name: "Coin-Operated Crowd Pummeler"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2114?namespace=static-8.3.7_35114-eu"), id: 2114, name: "Azerokk"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2115?namespace=static-8.3.7_35114-eu"), id: 2115, name: "Rixxa Fluxflame"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2116?namespace=static-8.3.7_35114-eu"), id: 2116, name: "Mogul Razdunk")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1012?namespace=static-8.3.7_35114-eu"), id: 1012), minimumLevel: 120, category: InstanceCategory(type: .dungeon)),
