        InstanceJournal(id: 1023, name: "Siege of Boralus", map: InstanceMapIndex(name: "Siege of Boralus", id: 1822), description: "Lady Ashvane has unleashed her fury against the capital city\'s waning defenses. As Boralus burns, a small group of heroes must quell the rising chaos and put an end to Ashvane\'s plan to dominate the region.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2132?namespace=static-8.3.7_35114-eu"), id: 2132, name: "Chopper Redhook"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2133?namespace=static-8.3.7_35114-eu"), id: 2133, name: "Sergeant Bainbridge"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2173?namespace=static-8.3.7_35114-eu"), id: 2173, name: "Dread Captain Lockwood"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2134?namespace=static-8.3.7_35114-eu"), id: 2134, name: "Hadal Darkfathom"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2140?namespace=static-8.3.7_35114-eu"), id: 2140, name: "Viq\'Goth")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1023?namespace=static-8.3.7_35114-eu"), id: 1023), minimumLevel: 120, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 1030, name: "Temple of Sethraliss", map: InstanceMapIndex(name: "Temple of Sethraliss", id: 1877), description: "Centuries ago, Sethraliss, a powerful snake loa, sacrificed herself to stop Mythrax from unleashing his master upon Azeroth. After the battle, her devoted followers transported her remains and built a temple around them while they awaited her rebirth. Now, a dark force stirs within this sacred temple that seeks to twist her power towards nefarious ends.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2142?namespace=static-8.3.7_35114-eu"), id: 2142, name: "Adderis and Aspix"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2143?namespace=static-8.3.7_35114-eu"), id: 2143, name: "Merektha"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2144?namespace=static-8.3.7_35114-eu"), id: 2144, name: "Galvazzt"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2145?namespace=static-8.3.7_35114-eu"), id: 2145, name: "Avatar of Sethraliss")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1030?namespace=static-8.3.7_35114-eu"), id: 1030), minimumLevel: 120, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 1036, name: "Shrine of the Storm", map: InstanceMapIndex(name: "Shrine of the Storm", id: 1864), description: "The Shrine of the Storm is a seat of power for both House Stormsong and the tidesages alike. Here, blessings upon the fleet are performed to ensure that the Kul Tiran fleet knows no equals in combat. Yet, a dark force has corrupted these sacred ground and threatens to steal control of the Kul Tiran Fleet forever.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2153?namespace=static-8.3.7_35114-eu"), id: 2153, name: "Aqu\'sirr"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2154?namespace=static-8.3.7_35114-eu"), id: 2154, name: "Tidesage Council"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2155?namespace=static-8.3.7_35114-eu"), id: 2155, name: "Lord Stormsong"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2156?namespace=static-8.3.7_35114-eu"), id: 2156, name: "Vol\'zith the Whisperer")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1036?namespace=static-8.3.7_35114-eu"), id: 1036), minimumLevel: 120, category: InstanceCategory(type: .dungeon)),
        InstanceJournal(id: 1041, name: "Kings\' Rest", map: InstanceMapIndex(name: "Kings\' Rest", id: 1762), description: "Few places in Zandalar are more sacred than Kings\' Rest. Every king, conqueror, or tyrant who has held control of the Zandalari empire is housed within this great city of the dead to protect and honor not only their bodies, but also their spirits.\r\n\r\nEntry has historically been restricted solely to the Zandalari priesthood and royalty, but as Zul\'s dark magic winds its way through the tomb you must venture inside and put an end to the darkness that has found purchase there.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2165?namespace=static-8.3.7_35114-eu"), id: 2165, name: "The Golden Serpent"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2171?namespace=static-8.3.7_35114-eu"), id: 2171, name: "Mchimba the Embalmer"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2170?namespace=static-8.3.7_35114-eu"), id: 2170, name: "The Council of Tribes"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2172?namespace=static-8.3.7_35114-eu"), id: 2172, name: "Dazar, The First King")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 5, isTracked: false), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 5, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC_KEYSTONE", name: "Mythic Keystone"), players: 5, isTracked: false)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1041?namespace=static-8.3.7_35114-eu"), id: 1041), minimumLevel: 120, categ