        InstanceJournal(id: 1178, name: "Operation: Mechagon", map: InstanceMapIndex(name: "Operation: Mechagon", id: 2097), description: "Prince Erazmin leads a group of unlikely allies on a desperate mission into the heart of Mechagon. In a race against time, they must overcome King Mechagon\'s army of mechanized monstrosities and defeat the mad genius before his doomsday device purges all organic life from Azeroth.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2357?namespace=static-8.3.7_35114-eu"), id: 2357, name: "King Gobbamak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2358?namespace=static-8.3.7_35114-eu"), id: 2358, name: "Gunker"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2360?namespace=static-8.3.7_35114-eu"), id: 2360, name: "Trixie & Naeno"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2355?namespace=static-8.3.7_35114-eu"), id: 2355, name: "HK-8 Aerial Oppression Unit"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2336?namespace=static-8.3.7_35114-eu"), id: 2336, name: "Tussle Tonks"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2339?namespace=static-8.3.7_35114-eu"), id: 2339, name: "K.U.-J.0."), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2348?namespace=static-8.3.7_35114-eu"), id: 2348, name: "Machinist\'s Garden"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2331?namespace=static-8.3.7_35114-eu"), id: 2331, name: "King Mechagon")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "HER